import UIKit

/*
 Source: https://www.hackerrank.com/challenges/ctci-making-anagrams/problem
 Problem Statement:
 Alice is taking a cryptography class and finding anagrams to be very useful. We consider two strings to be anagrams of each other if the first string's letters can be rearranged to form the second string. In other words, both strings must contain the same exact letters in the same exact frequency For example, bacdc and dcbac are anagrams, but bacdc and dcbad are not.
 
 Alice decides on an encryption scheme involving two large strings where encryption is dependent on the minimum number of character deletions required to make the two strings anagrams. Can you help her find this number?
 
 Given two strings,  and , that may or may not be of the same length, determine the minimum number of character deletions required to make  and  anagrams. Any characters can be deleted from either of the strings.
 
 Input Format
 
 The first line contains a single string, .
 The second line contains a single string, .
 
 Constraints
 
 It is guaranteed that  and  consist of lowercase English alphabetic letters (i.e.,  through ).
 Output Format
 
 Print a single integer denoting the number of characters you must delete to make the two strings anagrams of each other.
 
 Sample Input
 
 cde
 abc
 
 Sample Output
 
 4
 
 */

func anagram(string1: String, string2: String) -> Int{
    
    
    //let alphabets : Array<Character> = ["a","b","c","d","e","f","g","h","i","j","k","l","m","n","o","p","q","r","s","t","u","v","w","x","y","z"]
    
    var alphabets = [String]();
//    let charact = "a"
//    let ns = UnicodeScalar(charact)
    let startingValue = Int(UnicodeScalar("a").value) // 65
    for i in 0 ..< 26 {
        //print(Character(UnicodeScalar(i + startingValue)!))
        alphabets.append(String(UnicodeScalar(i + startingValue)!));
    }
    
    var alphabetsFreq = [String: Int]()
    for i in 0 ..< alphabets.count {
        alphabetsFreq[alphabets[i]] = 0
    }
    
    //bacdc
    //dcbac
    // O(n)
    print("Str1 Count \(string1.count) and Str2 Count \(string2.count)")
    let maxCount =  max(string1.count, string2.count)
    
    for i in 0 ..< maxCount {
        if (i < string1.count){
            let char = string1.index(string1.startIndex, offsetBy: i);
            let str = string1[char];
            let index = alphabets.index(of: String(str))
            //print("Str: \(str) Alpha: \(alpha)")
            alphabetsFreq[alphabets[index!]] =  alphabetsFreq[alphabets[index!]]!  + 1//Int(UnicodeScalar(alphabets[index!])!.value) - Int(UnicodeScalar(String(str))!.value)
        }
        
        if (i < string2.count){
            let char = string2.index(string2.startIndex, offsetBy: i);
            let str = string2[char];
            let index = alphabets.index(of: String(str))
            //print("Str: \(str) Alpha: \(alpha)")
            alphabetsFreq[alphabets[index!]] =  alphabetsFreq[alphabets[index!]]!  - 1
        }
    }
    // = O(2n) complexity
    
    var removeCount = 0
    for key in alphabetsFreq.keys {
        let value = Int(alphabetsFreq[key]!)
        removeCount = removeCount + abs(value)
    }
    return removeCount
}

let str1 = ""


let str2 = ""

print(anagram(string1: str1, string2: str2))

 




